// SPDX-License-Identifer: MIT
pragma solidity ^0.8.0;

import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";


contract ERA is ERC721A, Ownable{

    uint256 public constant MAX_SUPPLY = 2222;
    uint256 public constant MAX_PUBLIC_MINT = 25;
    uint256 public constant MAX_WHITELIST_MINT = 10;
    uint256 public constant PUBLIC_SALE_PRICE = .05 ether;
    uint256 public constant WHITELIST_SALE_PRICE = .04 ether;

    uint256 public constant MAX_WHITELIST_SUPPLY = 555;
    uint256 public totalWhiteListMinted;

    string private  baseTokenUri;
    string public   placeholderTokenUri;

    bool public publicSale;
    bool public whiteListSale;
    bool public teamMinted;

    mapping(address => uint256) public totalPublicMint;
    mapping(address => uint256) public totalWhitelistMint;

    constructor() ERC721A("ERA", "ERA"){
        whiteListSale = true;
    }

    modifier callerIsUser() {
        require(tx.origin == msg.sender, "ERA :: Function cannot be called by a contract");
        _;
    }

    function mint(uint256 _quantity) external payable callerIsUser{
        require(publicSale, "ERA:: Not Yet Active.");
        require((totalSupply() + _quantity) <= MAX_SUPPLY, "ERA :: Beyond Max Supply");
        require((totalPublicMint[msg.sender] +_quantity) <= MAX_PUBLIC_MINT, "ERA :: Cannot mint beyound 25 ERA!");
        require(msg.value >= (PUBLIC_SALE_PRICE * _quantity), "ERA :: Payment is below the price");

        totalPublicMint[msg.sender] += _quantity;
        _safeMint(msg.sender, _quantity);
    }

    function whitelistMint(uint256 _quantity) external payable callerIsUser{
        require(whiteListSale, "ERA :: Minting is on Pause");
        require((totalSupply() + _quantity) <= MAX_SUPPLY, "ERA :: Cannot mint beyond max supply");
        require((totalWhitelistMint[msg.sender] + _quantity)  <= MAX_WHITELIST_MINT, "ERA :: Cannot mint beyond whitelist max mint!");
        require(msg.value >= (WHITELIST_SALE_PRICE * _quantity), "ERA :: Payment is below the price");
        require(totalWhiteListMinted + _quantity <= MAX_WHITELIST_SUPPLY, "ERA :: Cannot mint beyound max whitelist supply");

        totalWhitelistMint[msg.sender] += _quantity;
        totalWhiteListMinted += _quantity;
        _safeMint(msg.sender, _quantity);
    }

    function teamMint() external onlyOwner{
        require(!teamMinted, "ERA :: Team already minted");
        teamMinted = true;
        _safeMint(msg.sender, 32);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenUri;
    }


    function setTokenUri(string memory _baseTokenUri) external onlyOwner{
        baseTokenUri = _baseTokenUri;
    }
    function setPlaceHolderUri(string memory _placeholderTokenUri) external onlyOwner{
        placeholderTokenUri = _placeholderTokenUri;
    }

    function toggleWhiteListSale() external onlyOwner{
        whiteListSale = !whiteListSale;
        publicSale = !publicSale;
    }

    function togglePublicSale() external onlyOwner{
        publicSale = !publicSale;
        whiteListSale = !whiteListSale;
    }

    function withdraw() external payable onlyOwner{
        payable(msg.sender).transfer(address(this).balance);
    }
}
